import React, { Component } from 'react';
import { connect } from 'react-redux';
import { Responsive, WidthProvider } from 'react-grid-layout';
import { dataActions } from '../../actions';
import Locations from '../Locations/Locations';
import ReactDOM from 'react-dom';

const ResponsiveGridLayout = WidthProvider(Responsive);
const layouts = {
  lg: [
    { i: 'a', h: 3, w: 6, x: 0, y: 0 },
    { i: 'b', h: 3, w: 6, x: 6, y: 0 },
    { i: 'c', h: 5, w: 12, x: 0, y: 3 },
  ],
  sm: [
    { i: 'a', h: 3, w: 3, x: 0, y: 0 },
    { i: 'b', h: 3, w: 3, x: 3, y: 0 },
    { i: 'c', h: 5, w: 6, x: 0, y: 3 }
  ],
  md: [
    { i: 'a', h: 3, w: 5, x: 0, y: 0 },
    { i: 'b', h: 3, w: 5, x: 5, y: 0 },
    { i: 'c', h: 5, w: 10, x: 0, y: 3 }
  ],
  xs: [
    { i: 'a', h: 3, w: 3, x: 0, y: 0 },
    { i: 'b', h: 3, w: 3, x: 3, y: 0 },
    { i: 'c', h: 5, w: 6, x: 0, y: 3 }
  ],
  xxs: [
    { i: 'a', h: 3, w: 1, x: 0, y: 0 },
    { i: 'b', h: 3, w: 1, x: 1, y: 0 },
    { i: 'c', h: 5, w: 6, x: 0, y: 3 }
  ]
};

class DashboardPage extends Component {
  constructor(props) {
    super(props);

    this.state = {
      dropdownOpen: false,
      radioSelected: 2,
    };
  }

  async componentDidMount() {
    const { dispatch } = this.props;
    await dispatch(dataActions.populateDashboard());
    const locations_container = document.querySelector('#locations_container');
    await ReactDOM.render(<Locations />, locations_container);
  }


  loading = () => <div className="animated fadeIn pt-1 text-center">Loading...</div>

  render() {
    return (
      <div>
        <ResponsiveGridLayout className="layout" layouts={layouts}
          breakpoints={{ lg: 1200, md: 996, sm: 768, xs: 480, xxs: 0 }}
          cols={{ lg: 12, md: 10, sm: 6, xs: 4, xxs: 2 }}>
          <div key='a' className="data-container">
            <h6 className="header-text">Locations</h6>
            <div id="locations_container"></div>
          </div>
          <div key='b'>
            <div className="data-container">
              <h6 className="header-text">Active Order List</h6>
              <div id="claimed_container"></div>
            </div>
          </div>
          <div key='c'>
            <div className="data-container">
              <h6 className="header-text">Daily Sales Report</h6>
              <div className="sales-report-container">
                <div className="peers ai-c jc-sb gap-40">
                  <div className="peer peer-greed">
                    <h5>September 7<sup>th</sup>, 2018</h5>
                    <p className="mB-0">Sales Report</p>
                  </div>
                  <div className="peer">
                    <h3 className="text-right">$512</h3>
                  </div>
                </div>
              </div>
              <div className="table-container">
                <table className="table">
                  <thead>
                    <tr>
                      <th className=" bdwT-0">Name</th>
                      <th className=" bdwT-0">Feedback</th>
                      <th className=" bdwT-0">Time</th>
                      <th className=" bdwT-0">Price</th>
                    </tr>
                  </thead>
                  <tbody>
                    <tr>
                      <td className="fw-600">Chicken Bacon Ranch Pizza</td>
                      <td><span className="badge bgc-green-50 c-green-700 p-10 lh-0 tt-c badge-pill">5 stars</span> </td>
                      <td>3:25pm</td>
                      <td><span className="text-info">$3.50</span></td>
                    </tr>
                    <tr>
                      <td className="fw-600">Chicken Panini</td>
                      <td><span className="badge bgc-green-50 c-green-700 p-10 lh-0 tt-c badge-pill">5 stars</span> </td>
                      <td>3:28pm</td>
